open Consensus
open Consensus.Serialization
open FsBech32

[<EntryPoint>]
let main _ =
    let txHex = ""
    let txBytes = Base16.decode txHex |> Option.get

    let blockHex = ""
    let blockBytes = Base16.decode blockHex |> Option.get

    let count = 1000

    let tx = Transaction.deserialize Full txBytes |> Option.get
    Transaction.serialize Full tx |> ignore

    let sw = System.Diagnostics.Stopwatch.StartNew ()

    for i in 1 .. count do
        Transaction.serialize Full tx |> ignore

    sw.Stop()

    printfn "Transaction Serialize - Total: %d Per tx: %A" sw.ElapsedMilliseconds ((sw.ElapsedMilliseconds |> float) / (float count))

    let sw = System.Diagnostics.Stopwatch.StartNew ()

    for i in 1 .. count do
        TransactionExtended.deserialize txBytes |> ignore

    sw.Stop()

    printfn "Transaction Deserialize - Total: %d Per tx: %A" sw.ElapsedMilliseconds ((sw.ElapsedMilliseconds |> float) / (float count))

    let block = Block.deserialize blockBytes |> Option.get
    Block.serialize block |> ignore

    let sw = System.Diagnostics.Stopwatch.StartNew ()

    for i in 1 .. count do
        Block.serialize block |> ignore

    sw.Stop()

    printfn "Block Serialize - Total: %d Per block: %A" sw.ElapsedMilliseconds ((sw.ElapsedMilliseconds |> float) / (float count))

    let sw = System.Diagnostics.Stopwatch.StartNew ()

    for i in 1 .. count do
        Block.deserialize blockBytes |> ignore

    sw.Stop()

    printfn "Block Deserialize - Total: %d Per block: %A" sw.ElapsedMilliseconds ((sw.ElapsedMilliseconds |> float) / (float count))

    0 // return an integer exit code
